"use strict";(self.webpackChunkk_6_workshop_api_docs=self.webpackChunkk_6_workshop_api_docs||[]).push([[53],{1109:e=>{e.exports=JSON.parse('{"pluginId":"default","version":"current","label":"Next","banner":null,"badge":false,"noIndex":false,"className":"docs-version-current","isLast":true,"docsSidebars":{"tutorialSidebar":[{"type":"link","label":"Introductie","href":"/k6-workshop-api-docs/docs/intro","docId":"intro"},{"type":"link","label":"Uitleg K6","href":"/k6-workshop-api-docs/docs/k6","docId":"k6"},{"type":"link","label":"Opdrachten","href":"/k6-workshop-api-docs/docs/excercises","docId":"excercises"},{"type":"link","label":"Usecases","href":"/k6-workshop-api-docs/docs/usecase","docId":"usecase"},{"type":"link","label":"Usecase 1","href":"/k6-workshop-api-docs/docs/usecase1","docId":"usecase1"},{"type":"link","label":"Usecase 2","href":"/k6-workshop-api-docs/docs/usecase2","docId":"usecase2"},{"type":"link","label":"Usecase 3","href":"/k6-workshop-api-docs/docs/usecase3","docId":"usecase3"}]},"docs":{"excercises":{"id":"excercises","title":"Opdrachten","description":"Opdracht 1 - Oefening","sidebar":"tutorialSidebar"},"intro":{"id":"intro","title":"Introductie","description":"In deze expert workshop gaan we verschillende performancetesten maken en uitvoeren op een RPi (Raspberry Pi). Op de RPi is een applicatie ge\xefnstalleerd, daarnaast is er ook een grafana dashboard aanwezig dat een overzicht laat zien van de resources van de RPi. Per RPi ligt er een informatie blad met daarop de url\'s van de applicatie en het grafana dashboard.","sidebar":"tutorialSidebar"},"k6":{"id":"k6","title":"Uitleg K6","description":"K6 is een Javascript performancetest tool voor zowel lokaal als cloud. Doordat de performancetesten in Javascript (ES6) geschreven worden maakt dit het voor programmeurs en testers toegankelijk. Wat zijn de standaard elementen in een performancetest script?","sidebar":"tutorialSidebar"},"usecase":{"id":"usecase","title":"Usecases","description":"Klasse! Je hebt de opdrachten doorlopen en bent klaar om met de usecases te beginnen. Er zijn drie verschillende usecases. Elke usecase heeft ander scenario die een bepaald performance probleem bevat. Probeer dit probleem te achterhalen en daarop een performancetest te maken die dit probleem erkent.","sidebar":"tutorialSidebar"},"usecase1":{"id":"usecase1","title":"Usecase 1","description":"Voor project Y, moet er een performancetest gemaakt worden die valideert of de applicatie de load aan kan. De applicatie staat al enige tijd live, maar het management twijfelt of de applicatie de load aankan vanwege wisselende signalen van zowel gebruikers als ontwikkelteams. Verspreid over de dag heeft de applicatie zo\'n 465 actieve gebruikers. Onze applicatie is een API, waar andere teams in de keten gebruik van maken. De API wordt alleen gebruikt tijdens werktijden. Het endpoint dat wordt aangesproken door de andere applicaties in de keten is http8888/demo","sidebar":"tutorialSidebar"},"usecase2":{"id":"usecase2","title":"Usecase 2","description":"Project NOK, gaat volgende week maandag om 19.00 live en we verwachten op het moment van live gaan een grote hoeveelheid gebruikers. We willen uiteraard niet onderuit gaan tijdens dit moment maar we weten niet of we de verwachte vraag aankunnen. Door problemen tijdens de ontwikkeling konden we niet eerder testen.","sidebar":"tutorialSidebar"},"usecase3":{"id":"usecase3","title":"Usecase 3","description":"Voor het project LKM ervaren we performance problemen wanneer de applicatie voor een langere tijd gebruikt wordt. Het aantal users verschilt heel erg waardoor we niet goed de vinger op de zere plek kunnen leggen.","sidebar":"tutorialSidebar"}}}')}}]);